import React from "react";
import explicit from "./explicit.png";
import "./tracks.css";
import { Popover, OverlayTrigger, Button } from "react-bootstrap";

export default function TrackSearchResult({ track, chooseTrack }) {
  function handlePlay() {
    chooseTrack(track);
  }
  const popover = (
    <Popover id="popover-basic">
      <Popover.Title as="h3">Popover right</Popover.Title>
      <Popover.Content>
        <strong>Playlists</strong>
      </Popover.Content>
    </Popover>
  );

  const Example = () => (
    <OverlayTrigger trigger="click" placement="left" overlay={popover}>
      <Button variant="success">Click me to see</Button>
    </OverlayTrigger>
  );
  //console.log(artist);
  return (
    <div className="d-flex m-2">
      <div
        className="d-flex m-2 align-items-center"
        id="tracks"
        style={{ cursor: "pointer" }}
        onClick={handlePlay}
      >
        {" "}
        <div className="m-2">{track.rank}</div>
        <img
          src={track.art}
          className="m-2"
          style={{ height: "64px", width: "64px" }}
        />
        <div id="trackDetails" className="m-2">
          <div>
            {track.name}{" "}
            {track.explicit ? (
              <img
                src={explicit}
                style={{ height: "16px", width: "16px" }}
              ></img>
            ) : (
              " "
            )}
          </div>
          <div className="text-muted">{track.albumName}</div>
          <div className="text-muted">{"Released: " + track.release}</div>
          {/* <div className="text-muted">{track.artist}</div> */}
        </div>
      </div>
      <div id="playlist-button">
        <Example />
      </div>
    </div>
  );
}
